Male Genitalia (Figs. 
71–72
): Uncus elongate, broadly constricted above a wide base, widened subapically, apex setose and acuminate; gnathos setose, protuberant, wide throughout length, upturned apically; tegumen slightly widened basally; dorsal strut of tegumen with arms convergent from a wide base, fusing midway from posteroventral margin of tegumen to base of uncus; costa nearly straight from a shallow depression slightly beyond a slanted, basal digitate process to apical furca; furca acuminate, slightly upturned; sacculus twisted apically, constricting valva slightly before middle, widened distoventrally, forming an elongate and broadly rounded cucullus; cucullus membranous and setose, with a short, narrowly rounded outer margin; vesica denticulate, bearing a large, hornlike, apical cornutus; cornutus dilated basally, exposing a hollow, basal cavity.

Female Genitalia (Fig. 
282
): Papillae anales elongate, wider basally than apically; apophysis posterioris and apophysis anterioris about equal in length; eighth sternum about equal in width as eighth tergum; posterior margins of eighth sternum and eighth tergum broadly rounded; anterior margin of eighth sternum broadly emarginate, anterior margin of eighth tergum straight; antrum greatly enlarged posterolaterally from a broadly constricted anterior part, posterior margin broadly emarginate medially, posterolateral margins broadly rounded; anterior part of antrum bearing a pair of elongate, spinelike processes inside cavity formed from outer wall; ductus bursae short; corpus bursae densely denticulate within anterior half; ductus seminalis basally enlarged, coiled from base to apex, each coil gradually narrowed distally; ductus bursae with a short, single­coiled, internal support; membrane of basal coil slightly denticulate; side opposite ductus seminalis with a convoluted, internal plate.
